import React, { Fragment } from "react";
import CatCard from "./CatCard/CatCard";

const CatParadiseBody = (props) => {
  function getCatCardList() {
    const { catBreeds } = props;

    const catCardList = props.catBreeds.map((cat) => {
      if (cat.image !== undefined && cat.image.id !== undefined)
        return (
          <li key={cat.image.id}>
            <CatCard cat={cat}></CatCard>
          </li>
        );
    });

    return catCardList;
  }
  return <div className="cart-cards">{getCatCardList()}</div>;
};

export default CatParadiseBody;
